import './MovieTag.scss'

class MovieTag extends Component {
    render() {
        return (
            <div className="movie-tag">
             <img src="https://image.tmdb.org/t/p/original/iXbWpCkIauBMStSTUT9v4GXvdgH.jpg" alt="" />
             <p>P</p><span>The Suid</span>
            </div>
        );
    }
}

export default MovieTag;
